import NavigationItem from './NavigationItem/NavigationItem';

const navigationItems = ( props ) => (
    <ul className={props.styling}a>
        <NavigationItem link="/">
            Home
        </NavigationItem>
        <NavigationItem link="/">
            About Me
        </NavigationItem>
        <NavigationItem link="/">
            Works
        </NavigationItem>
    </ul>
);

export default navigationItems;
